# Extended euclidean algorithm
def egcd(a,b):
    if (a%b == 0):
        return b, 0, 1
    else:
        # q: quotient of a/b
        # r: remainder of a/b
        q,r = divmod(a,b)
        d,x,y = egcd(b,r)
        # d is the greatest common divisor of a and b
        # d = y*a + (x-y*q)*b
        return d, y, x - y * q

# Compute modular inverse x
# where ax = 1 mod m   
def mod_inv(a,m):
    d,x,_ = egcd(a,m)
    if d == 1:
        return x % m
    return -1



