    normalized_keys = [RSA.construct((key.n, key.e, key.d), False) for key in priv_keys]
    
    # Convert to a hashable unique string
    sorted_priv_keys = b''.join(sorted([priv_key.export_key() for priv_key in normalized_keys]))
    return sha256(sorted_priv_keys).hexdigest() == 'fc6818202e316c0141a5e11208466ce35c13b5469546555b7f1b1b5905b9f9ad'



